import React from 'react';

const TodoList = () =>
{
	const items = ['Дело 1', 'Дело 2', 'Дело 3'];
	return(
		<ul>
			<li>{items[0]}</li>
			<li>{items[1]}</li>
			<li>{items[2]}</li>
		</ul>
	);
};

export default TodoList;
